using Izibiz_dotnet_rest_client;
using Izibiz_dotnet_rest_client.Adapter;
using Izibiz_dotnet_rest_client.Operations;
using Izibiz_dotnet_rest_client.Request;
using NUnit.Framework;
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;

namespace Samples.ECurrency
{
    public class ECurrency
    {
        private readonly IzibizClient _izibizClient = new IzibizClient();
        ECurrencyRequest eCurrencyReq;
        [Test, Order(1)]
        public void ECurrency_JsonPost()
        {
            ECurrencyRequest request = new ECurrencyRequest();
            var response = _izibizClient.ECurrency().ECurrencyInformation(request, Authentication.Token);
            System.Diagnostics.Debug.WriteLine("DAB - EUR - Gönderme : " + response.data);
        }


         [Test, Order(2)]
        public void ECurrencyList()
        {
            var request = _izibizClient.ECurrency().ECurrencyList(Authentication.Token);
            Assert.NotNull(request);
            System.Diagnostics.Debug.WriteLine("E-Döviz Listesi : ");
            foreach (var ecurrency in request.contents)
            {
                System.Diagnostics.Debug.WriteLine("Belge Numarası : " + ecurrency.documentNo + "Belge Tip: " + ecurrency.documentType);
            }
        }

          [Test, Order(3)]
        public void ECurrency_Html()
        {
            var request = _izibizClient.ECurrency().ECurrencyDocument(Authentication.Token, "HTML");
            Assert.NotNull(request);
            FolderOperations.SaveToDisk(nameof(EI.Type.ECurrency), nameof(EI.DocumentType.HTML), request);
        }

         [Test, Order(3)]
        public void ECurrency_PDF()
        {
            var request = _izibizClient.ECurrency().ECurrencyDocument(Authentication.Token, "PDF");
            Assert.NotNull(request);
            FolderOperations.SaveToDisk(nameof(EI.Type.ECurrency), nameof(EI.DocumentType.PDF), request);
        }

        [Test, Order(4)]
        public void ECurrency_SendJson()
        {


            var response = _izibizClient.ECurrency().ECurrencySendJson(Authentication.Token);
            byte[] content = FolderOperations.DecompressZip(response.content);
            File.WriteAllBytes(Environment.GetFolderPath(Environment.SpecialFolder.MyDocuments) + @"\" + response.filename.Replace(".zip", ".xml").ToString(), content);
        }


        [Test, Order(5)]
        public void ECurrency_CompressUblSend()
        {

            var req = new ECurrencyCompressUblRequest
            {
                documentAction = "SEND",
                compressed = true,
                //Gönderilmesi gereken ubl dosyasını zipleyerek base64 tipinde content alanına verilmesi gerekmektedir.
                content = ""
            };
            var response = _izibizClient.ECurrency().ECurrencyCompressUBL(Authentication.Token,req);
            Assert.NotNull(response);
            if (response.data == null)
            {
                System.Diagnostics.Debug.WriteLine(response.error.message);
            }
            Assert.NotNull(response.data);
     }

    }
}